package com.ajie.wechat.model;

import java.math.BigDecimal;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.Id;
import javax.persistence.Table;

@Entity
@Table(name = "jt_other_company_bid")
public class JtOtherCompanyBid {
	
	@Id
//	@GeneratedValue(strategy = GenerationType.IDENTITY)//如果这行不写，则需要保存时手动生成主键
	@Column(name = "otherbidid")
	private int otherbidid;
	
	private String mrecid;
	
	private String recid;
	
	private String cxmid;
	
	private String cqttbid;
	
	private int trackrecid;
	
	private int baserecid;
	
	private String tbdw;
	
	private String dwmc;
	
	private BigDecimal tbbj;
	
	private String sfzb;
	
	private BigDecimal zbe;
	
	private String jedw;
	
	private String synstatus;
	
	private String pimsid;
	
	private String jtrecid;

	public int getOtherbidid() {
		return otherbidid;
	}

	public void setOtherbidid(int otherbidid) {
		this.otherbidid = otherbidid;
	}

	public String getMrecid() {
		return mrecid;
	}

	public void setMrecid(String mrecid) {
		this.mrecid = mrecid;
	}

	public String getRecid() {
		return recid;
	}

	public void setRecid(String recid) {
		this.recid = recid;
	}

	public String getCxmid() {
		return cxmid;
	}

	public void setCxmid(String cxmid) {
		this.cxmid = cxmid;
	}

	public String getCqttbid() {
		return cqttbid;
	}

	public void setCqttbid(String cqttbid) {
		this.cqttbid = cqttbid;
	}

	public int getTrackrecid() {
		return trackrecid;
	}

	public void setTrackrecid(int trackrecid) {
		this.trackrecid = trackrecid;
	}

	public int getBaserecid() {
		return baserecid;
	}

	public void setBaserecid(int baserecid) {
		this.baserecid = baserecid;
	}

	public String getTbdw() {
		return tbdw;
	}

	public void setTbdw(String tbdw) {
		this.tbdw = tbdw;
	}

	public String getDwmc() {
		return dwmc;
	}

	public void setDwmc(String dwmc) {
		this.dwmc = dwmc;
	}

	public BigDecimal getTbbj() {
		return tbbj;
	}

	public void setTbbj(BigDecimal tbbj) {
		this.tbbj = tbbj;
	}

	public String getSfzb() {
		return sfzb;
	}

	public void setSfzb(String sfzb) {
		this.sfzb = sfzb;
	}

	public BigDecimal getZbe() {
		return zbe;
	}

	public void setZbe(BigDecimal zbe) {
		this.zbe = zbe;
	}

	public String getJedw() {
		return jedw;
	}

	public void setJedw(String jedw) {
		this.jedw = jedw;
	}

	public String getSynstatus() {
		return synstatus;
	}

	public void setSynstatus(String synstatus) {
		this.synstatus = synstatus;
	}

	public String getPimsid() {
		return pimsid;
	}

	public void setPimsid(String pimsid) {
		this.pimsid = pimsid;
	}

	public String getJtrecid() {
		return jtrecid;
	}

	public void setJtrecid(String jtrecid) {
		this.jtrecid = jtrecid;
	}
	
}
